import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function Navbar() {
  return (
    <nav>
      <h1 className="">Brand</h1>
      <ul className="text-xl m-2">
        <li>Priceing</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

ReactDOM.render(<Navbar />, document.getElementById("root"));
